import './App.css';

function App() {
	return (
		<div className="App">
			<header className="header">
				<h1>Hyeri Portfolio</h1>
			</header>

			<div className="container">
					<div className="box">
						<h2>Box 1</h2>
					</div>
					<div className="box">
						<h2>Box 2</h2>
					</div>
				</div>
		</div>
	);
}

export default App;
